INSERT INTO `agent_page_features` (`id`, `title`, `description`, `type`, `updatedon`) VALUES
(1, 'Use our app for free', 'For a limited time only, earn *100% of what you deliver and get paid. (*Subjected to revision without prior notice)', 'features', '2017-08-15 04:41:02'),
(2, 'Enhance your income', 'Take charge of your earning potentials', 'features', '2017-08-15 04:41:25'),
(3, 'Flexible Working Hours', 'Spend more quality time with your family.', 'features', '2017-01-09 05:31:44'),
(4, 'Download Our App', 'Kourier app allows agents to access delivery requests nationwide 24/7 , anytime and anywhere.', 'features-more', '2017-01-09 06:14:39'),
(5, 'Sign Up as a Delivery Agent', 'Delivery Agents get unique features to update the status of the deliveries, get notified on delivery requests and contact customers on the go!', 'features-more', '2017-01-20 00:43:52'),
(6, 'Get Verified', 'Kourier is built on a trusted community of delivery agents. We need your profile to be completed and verified before you can start delivering. There are no strangers on Kourier!', 'features-more', '2017-01-20 00:45:17'),
(7, 'Ready to Deliver', 'Everyone loves to receive parcels and you are the one to make it happen!', 'features-more', '2017-08-15 04:42:13'),
(8, 'Batch Deliveries', 'Multiple delivery orders from<br>one pickup location.', 'features-more', '2016-11-03 10:28:43'),
(9, 'Live Tracking', 'Track location of delivery agent</br> with status updates', 'features-more', '2017-08-15 04:42:40'),
(10, 'Earn Money On The Go', 'Earn income while doing your usual routine.', 'features', '2017-01-09 05:32:51');
