(237, 'Eunice Ng', 'eunice@feetcare.co', '', 'Hi there, \r\n\r\nI am writing to you on behalf of Feet Care Pte Ltd. We are a retail and wholesale company selling feet related products as well as providing safety shoes to our clients. \r\n\r\nWe are in the midst of sourcing courier delivery as our business is expanding with a higher volume of goods to be delivered, and hence would like to understand more about the services that you currently offer. \r\n\r\nOur orders can vary, from delivering 2 pairs of shoes to more than 50 pairs to a client. \r\n\r\nHence, we would like to know your rates and cut off timings for: \r\n- Same day delivery \r\n- Next day delivery \r\n- Express / urgent delivery \r\n\r\nDo you calculate the rates based on weightage, or by the number of items delivered? \r\n\r\nDo you offer discounts to corporate clients, and may I know what are your payment terms like? \r\n\r\nIt will be great if you are able to provide a chart with the breakdown of the services. \r\n\r\nLooking forward to your reply! I can be contacted through this email.\r\n\r\nThank you! \r\n\r\nEunice\r\nFeetCare', '', '', '', 12, '2017-10-24 03:09:40'),
