(273, 'Sarima', 'sarima.eusuff@ssi-schaefer.com', '68630168', 'Dear Officer,\r\n\r\nI found out about your company profile and services via the website. I am actually looking for a courier service company where we can engage to run errands for my company. Most of the errands are delivery/collection of documents to/from companies/banks, quick cheque deposit, submission of travel documents to travel agents for visa application, renewal of social visit pass/passport to MOM, SIR, embassy etc. We may require parcel service or van service sometimes.\r\n\r\nBy looking at the errands above, I would like to have your proposal where you can offer to my company. It would be good if you could offer us a Credit Term payment instead of COD.\r\nPlease submit your proposal via email or fax. Alternatively, you could also call me to discuss on the services. Look forward to your favourable reply soon. Thank you.\r\n\r\nKind regards,\r\nSarima Eusuff | Admin Assistant | Office Administration\r\nSSI SCHAEFER | Schaefer Systems International Pte Ltd | 73 Tuas Ave 1 | Singapore 639512', '', '', '', 12, '2017-11-08 04:32:52'),
