(391, 'Martin Koh', 'zhenye1990@gmail.com', '84007033', 'Dear kourier,\r\n\r\nI am looking for a reliable delivery service partner for my company, and I feel that your company would be a very good choice. May I know if your company is keen to work with my company as a delivery service provider? We need you to pick up our items at our pick up point and deliver island-wide to customers in Singapore, in 2-3 working days, and pick up item before 5pm.\r\n\r\nMy company''s business is Kah Huat Dress Maker, located at 115A Commonwealth Dr, Singapore 149596. It is in the school uniform industry, where we are the suppliers of a number of Singapore schools for their uniforms, including primary and secondary. Our commodities are school uniforms, including, but not limited to; shirts, shorts, long pants, blouses, skirts, PE T-shirts, and PE shorts. When mailing out, items size and weight would vary. This is due to difference in orders of customers. Our most common and average weight would be less than 4kg per shipment. The dimensions are about 35cm in length, 30cm in breadth, and around 15cm in height. We only send the items locally in Singapore.\r\nWe will need you to constantly deliver our uniform island-wide to our customers as a main delivery service provider, when needed, and at our pick up point at Commonwealth. The frequency of delivery depends greatly on the customers orders. The value of the product is about $70 for a full 2 sets of uniform. We are delivering to customers, so it will be a B2C delivery.\r\n\r\nPlease provide me with the necessary information if we are able to have a partnership, including the rates of delivery, policies, etc. and whether there are special rates for a contract deal (we need a main and reliable delivery partner)\r\nI also do hope that my company would be able to receive a better rate for a 2-3 days requirement, instead of 24 hours.\r\n\r\nI look forward to receiving your reply. Thank you so much.\r\n\r\nBest Regards,\r\n\r\nMartin', '', '', '', 12, '2017-12-12 13:52:54'),
