(428, 'Xerxes Wong', 'sg.sales@globaloutsourceasia.com', '91223516', 'Greetings from Global Outsource Solutions!\r\nGlobal Outsource Solutions Pte Ltd (GOS) is under Pang Kim Hin Group of Companies that includes Mothercare Group in Singapore, Malaysia, Hong Kong and Vietnam. GOS is a regional distributor in South East Asia with offices in Singapore, Malaysia and Hong Kong. GOS distributes over 40 brands across baby and maternity merchandise in major specialist retailers, departmental stores, online stores and baby boutiques. GOS also operates a retail front "Not Too Big" that curates globally acquired boutique range of fashion labels across baby, kids and women''s wear. \r\n\r\nWe are keen to work with you as our trusted courier service.\r\nI will like to ask a few questions regarding lost/damaged parcels and delay in delivery before we proceed any further. \r\n\r\n1)	If customers find out that our products are damaged and want to do returns, will you provide any help on this issue?\r\n2)	In the event that there are lost parcels, will there be any sort of compensation to the company or the customers? If there is, will you provide the redelivery and purchase of the lost parcel at your own costs for the customers?\r\n3)	If there is any delay in the delivery of our parcels, how will you make it up to the customers? \r\n\r\nPlease get back to me via email.\r\nThank you.\r\n\r\nRegards,\r\nXerxes\r\nSales', '', '', '', 12, '2017-12-18 12:44:37'),
