(436, 'wilson', 'wongkwoksoon@yahoo.com.sg', '92282690', 'Hi Manager, \r\n\r\n  I have a small company dealing with ladies accessories. I need a courier service as follows, and request a quote per parcel.\r\n\r\n\r\na. 100 parcel / month\r\n\r\nb. no stringent requirement in delivery. But not too late, probably within 3-4 working days\r\n\r\nc. Items will be in courier bags. details. ladies wallets / small handbags , each less than 1 kg in a parcel, approx A4 size. \r\n\r\nd. my existing courier quotes me $5 / parcel. All have been good working relationship except they have been too slow this festive season, and I have faced too many complaints. need to change.', '', '', '', 12, '2017-12-19 17:27:02'),
