(442, 'Atticus', 'atticus@shoetreeproject.com', '82238332', 'Hello Kourier!\r\n\r\nI am interested to find out what services you provide for companies with a certain volume of deliveries every month.\r\n\r\nWe deliver at least a 100 parcels a month within Singapore. All parcels are below 5kg. The most common parcel by far measures approximately 29cm*12cm*8cm and weighs 0.7kg. Our customers expect their orders within 5 days of order - if collection occurs twice a week, that leaves 2-3 days for delivery for each parcel. We are open to other arrangements (:\r\n\r\nWe are hoping to work with a logistics company with specific services - I wonder if you could help me with the follow queries?\r\n\r\nRATES\r\n\r\nWhat are your delivery rates? In this instance, our customers do not mind waiting a few days, so affordability is a major priority.\r\n\r\nDELIVERY TIMEFRAME\r\n\r\nFor this, we''d like to come to an arrangement that is most convenient for your company. This segment of customers expect to receive their orders within 5 days. Depending on your delivery timeframe from the day of collection, we can minimize the number of weekly collections to make things more efficient. We can also have collections on fixed day and time of the week so that your driver''s route can be planned in advance to minimize costs on your end.\r\n\r\nTRACKING\r\n\r\nDo you provide a unique tracking number for each parcel? If so, what are the checkpoints for each delivery and is there a final delivery status? How can we, and our customers, access this information?\r\n\r\nREDELIVERY FOR FAILED DELIVERIES\r\n\r\nIf the customer isn''t in during delivery, how many redeliveries do you provide?\r\n\r\nCUSTOMER EXCHANGES\r\n\r\nSometimes, our customer would like to exchange faulty or wrongly sized products - what services do you offer for such situations?\r\n\r\nHANDLING OF FRAGILE ITEMS\r\n\r\nSome of the orders contain small glass jars. How do you handle fragile items? We do wrap these fragile items in double layers of bubble wrap - what else should be in the packaging (stickers etc)?\r\n\r\nDAMAGES/LOST PARCELS\r\n\r\nWhat happens in the event of lost or damaged parcels?\r\n\r\nLATE DELIVERIES\r\n\r\nWhat if delivery arrives late?\r\n\r\nCASH ON DELIVERY\r\n\r\nAre you able to collect cash for us upon delivery? If so, how and when will these be paid out to us?\r\n\r\nPAYMENT TERMS\r\n\r\nDo you have monthly postpaid payment terms?\r\n\r\nINTERNATIONAL\r\n\r\nWhat are your international capabilities, rates, and timeframes - namely for Malaysia and Indonesia?\r\n\r\nHear from you soon!', '', '', '', 12, '2017-12-20 15:53:40'),
