INSERT INTO `email` (`id_email`, `updated_date`, `variable_name`, `title`, `description`, `variable`) VALUES
(1, '2016-08-10 03:35:55', 'accountactivation', 'Account Email Verification', 'Dear {NAME},\r\n\r\nThank you for signing up at KourierApp, to activate your account,visit the following link:\r\n\r\n{ACTIVATIONLINK}\r\n\r\nIf you are not able to click on the above link, please copy and paste the URL in the browser.\r\n{SIGNATURE}', '{NAME} -Name of the registered user\n{ACTIVATIONLINK} - Activation Link\n{SIGNATURE}'),
(2, '2016-06-06 05:55:58', 'resetpassword', 'Password changed successfully', 'Dear {NAME},<br /><br />Your account password has been changed successfully. Now you can login with new credentials.<br /><br />{SIGNATURE}', '{NAME} -Name of the user\r\n{SIGNATURE}'),
(3, '2017-06-22 01:51:33', 'account-verification', 'Welcome to KourierApp', 'Dear {NAME}, \r\n\r\nThank you for signing up with KourierApp! You will soon be enjoying the ease of sending parcels anytime and anywhere. If you encounter difficulties to login, please email admin@kourier.sg. \r\n\r\nThanks. {SIGNATURE}', '{NAME}\r\n{SIGNATURE}'),
(6, '2016-06-06 05:15:00', 'forgotpassword-admin', 'Reset Password - Request from Admin', 'Dear {NAME},\r\n\r\nWe received your request to Reset the Password. Please click on following link to reset your password,\r\n\r\n{ACTIVATIONLINK}\r\n\r\n{SIGNATURE}', '{NAME} -Name of the admin\r\n{ACTIVATIONLINK} - Password reset link\r\n{SIGNATURE}'),
(8, '2016-07-08 04:56:57', 'adduser', 'Account created Successfully.', 'Dear {NAME},\r\n\r\nYour account has been created successfully.\r\n\r\nYour login credentials are:\r\n\r\nEmail:       {EMAIL}\r\nPassword: {PASSWORD}\r\n\r\n{SIGNATURE}', '{NAME} -Name of the signup user\n{EMAIL}-User Name of the signup user\n{PASSWORD}- Password of the signup user\n{SIGNATURE}'),
(9, '2016-07-08 04:56:51', 'forgotpassword', 'Reset Password - Request from User', 'Dear {NAME},<br /><br />We received your request to Reset the Password. Please use following link to reset your password,<br /><br />{RESETCODE}<br /><br />If you are not able to click on the above link, please copy and paste the URL in the browser.<br /><br />{SIGNATURE}', '{NAME} - Name of the user \n{RESETCODE} -Password reset code\n{SIGNATURE}'),
(11, '2016-06-06 05:57:56', 'contactus', 'Thanks for contacting us.', 'Dear {NAME},\r\n\r\nThanks for contacting {SITENAME}. We will get back to you as soon as possible.', '{NAME} -Name of the registered user\r\n{SIGNATURE}'),
(12, '2016-08-25 11:09:31', 'contactUsReply', 'Contact Us Reply', 'Dear {NAME},\n\n{MESSAGE}\n\nEnquiry: {ENQUIRY}', '{NAME}-Name of the contacted user\n{MESSAGE}- Message sent by admin\n{ENQUIRY} - Enquiry sent by user\n{SIGNATURE}'),
(13, '2016-06-06 05:58:06', 'contactus_admin', 'New Contact us enquiry.', 'Dear Admin,\r\n\r\nFollowing user has enquired :\r\n\r\nName: {NAME}\r\nEmail: {EMAIL}\r\nContact Number: {CONTACT}\r\nMessage: {MESSAGE}\r\n\r\n{SIGNATURE}', '{NAME} - Name of the registered user\r\n{SIGNATURE} - Signature of Email\r\n{MESSAGE} - message sent by user\r\n{CONTACT} - contact number of user'),
(21, '2016-06-06 05:56:56', 'order-accept', 'Your delivery is confirmed', 'Dear {CUSTOMER_NAME},\r\n\r\nWe would like to inform you that your delivery request is confirmed.\r\nPlease see way bill below:\r\n\r\n<b>Parcel Tracking Number:</b> {TRACKING_NUMBER}\r\n\r\n<b>Order Date:</b> {ORDER_DATE}\r\n\r\n<b>Delivery Agent Name:</b> {AGENT_NAME}\r\n\r\n<b>Delivery Agent Mobile:</b> {CONTACT_NUMBER}\r\n\r\nThank you for choosing KourierApp. We hope to deliver for you again.\r\n\r\n{SIGNATURE}\r\nDOWNLOAD OUR APP NOW:\r\nAPP STORE : {LINK_TO_APP_STORE}\r\nPLAY STORE: {LINK_TO_PLAY_STORE}', '{CUSTOMER_NAME}\r\n{TRACKING_NUMBER}\r\n{ORDER_DATE}\r\n{AGENT_NAME}\r\n{CONTACT_NUMBER}\r\n{LINK_TO_APP_STORE}\r\n{LINK_TO_PLAY_STORE}\r\n{SIGNATURE}'),
(22, '2017-09-11 06:27:48', 'status-change', 'Delivery status update | {PARCEL}', 'Dear {NAME},\r\n\r\nLatest Delivery Status: {STATUS}\r\n\r\nTracking Number:  {TRACKING_NUMBER}\r\nAgent Name:  {AGENT_NAME}\r\nAgent Contact Number:  {CONTACT_NUMBER}\r\n\r\n{SIGNATURE}\r\n\r\nDOWNLOAD OUR APP TO TRACK DELIVERIES LIVE \r\nAPP STORE : {LINK_TO_APP_STORE}\r\nPLAY STORE: {LINK_TO_PLAY_STORE}', '{NAME}\r\n{STATUS}\r\n{TRACKING_NUMBER}\r\n{AGENT_NAME}\r\n{CONTACT_NUMBER}\r\n{LINK_TO_APP_STORE}\r\n{LINK_TO_PLAY_STORE}\r\n{SIGNATURE}'),
(23, '2018-03-29 10:22:13', 'parcel-delivered', 'Parcel is delivered | {PARCEL}', 'Dear {NAME},\r\n\r\nWe would like to inform you that your parcel&nbsp; \r\n\r\n{TRACKING_NUMBER} is delivered.\r\n\r\nPlease find below the receipt for your delivery:\r\n\r\nReceipt No: {TRACKING_NUMBER}\r\nOrder Date: {ORDER_DATE}\r\nDelivery Agent: {AGENT_NAME}, {CONTACT_NUMBER}\r\n\r\nPickup Details:\r\n{PICKUP_NAME},\r\n{PICKUP_CONTACT}\r\n\r\nDelivery Details:\r\n{DELIVERY_NAME},\r\n{DELIVERY_CONTACT}\r\n\r\nReceived by: {RECEIVER_NAME}\r\nAmount Paid: {AMOUNT_PAID}\r\nPayment Method: {PAYMENT_METHOD}\r\n\r\nThank you for choosing KourierApp. We hope to deliver for you again.\r\n\r\n{SIGNATURE}\r\n\r\nDOWNLOAD OUR APP NOW:\r\nAPP STORE : {LINK_TO_APP_STORE}\r\nPLAY STORE: {LINK_TO_PLAY_STORE}\r\n\r\nwww.kourier.sg', '{NAME}\r\n{TRACKING_NUMBER}\r\n{ORDER_DATE}\r\n{AGENT_NAME}\r\n{CONTACT_NUMBER}\r\n{PICKUP_NAME}\r\n{PICKUP_CONTACT}\r\n{ACTUAL_TIME_PICKUP}\r\n{DELIVERY_NAME}\r\n{DELIVERY_CONTACT}\r\n{RECEIVER_NAME}\r\n{AMOUNT_PAID}\r\n{PAYMENT_METHOD}\r\n{SIGNATURE}\r\n{LINK_TO_APP_STORE}\r\n{LINK_TO_PLAY_STORE}\r\n{SIGNATURE}'),
(24, '2017-03-09 11:04:44', 'parcel-cancel-agent', 'Parcel Failed Delivery', 'Dear {NAME},\r\n\r\nYour delivery for Tracking Number -  {TRACKING_NUMBER} is failed.Please re-arrange a new delivery with the current agent.\r\n\r\n{SIGNATURE}\r\n\r\nDOWNLOAD OUR APP TO TRACK DELIVERIES LIVE \r\nAPP STORE : {LINK_TO_APP_STORE}\r\nPLAY STORE: {LINK_TO_PLAY_STORE}', '{NAME}\n{STATUS}\n{TRACKING_NUMBER}\n{SIGNATURE}\n{LINK_TO_APP_STORE}\n{LINK_TO_PLAY_STORE}'),
(25, '2017-03-02 05:41:46', 'subscription', 'Kourier Newsletter Verification', 'Dear {NAME},\r\n\r\nThank you for signing up newsletter at KourierApp, to subscribe newsletters,visit the following link:\r\n\r\n{ACTIVATIONLINK}\r\n\r\nIf you are not able to click on the above link, please copy and paste the URL in the browser.\r\n{SIGNATURE}', '{NAME} -Name of the registered user\n{ACTIVATIONLINK} - Activation Link\n{SIGNATURE}'),
(26, '2017-09-11 06:29:04', 'expired_job_email', 'Parcel Order Expired | {PARCEL}', 'Dear {NAME},\r\n\r\nYour job has been expired, Please go to Manage Delivery section to re-post your job.\r\n\r\n*This is an automatically generated email, please do not reply to this email address.*', '{NAME} - Name of the registered user\r\n{TRACKING_NUMBER} - tracking code'),
(27, '2017-09-11 06:29:24', 'order-canceled', 'Parcel Order Cancelled | {PARCEL}', 'Dear {NAME},\r\n\r\nYour order has been cancelled by an agent.\r\nA new agent will be assigned soon.\r\n\r\n*This is an automatically generated email, please do not reply to this email address.*', '{NAME}'),
(28, '2017-09-11 06:31:52', 'order-refund', 'Parcel Order Refund | {PARCEL}', 'Dear {NAME},\r\n\r\nParcel detail: {PARCEL}\r\n\r\nYour order has been refunded.\r\n\r\n*This is an automatically generated email, please do not reply to this email address.*', '{NAME}{PARCEL}'),
(29, '2017-10-30 00:33:46', 'promo_code', 'Kourier Promo Code', 'Dear {NAME},\n\nEnjoy discount with kourier using promo code <b>{PROMOCODE}</b> valid till <b>{VALIDDATE}</b>\n\n<b>Description</b> - {DESCRIPTION}\n\n<b>Discount</b> - {DISCOUNT}\n\n<b>Minimum Amount</b> - {MINIMUM}\n\n*This is an automatically generated email, please do not reply to this email address.*', '{NAME}\r\n{PROMOCODE}\r\n{VALIDDATE}\r\n{DESCRIPTION}\r\n{DISCOUNT}\r\n{MINIMUM}'),
(30, '2017-11-01 04:50:37', 'bookingconfirmation', 'Kourier Booking Confirmation', 'Dear {CUSTOMER_NAME}, \n\nWe would like to inform you that your delivery request is confirmed. \n\nPlease find details below:\n\n<b>Booking Date/Time:</b> {DATETIME}\n\n<b>Pick up date:</b> {DATE} \n\n<b>Pick up time:</b> {TIME} \n\n<b>Address:</b> {ADDRESS} \n\nPlease find attached invoice. \nThank you for choosing Kourier App. We hope to deliver for you again. \n*** This is an automatically generated email, please do not reply ***', '{CUSTOMER_NAME} {PARCEL} {DATE_TIME} {DATE} {TIME} {ADDRESS}{CUSTOMER_NAME}\n{DATETIME} \n{DATE} \n{TIME} \n{ADDRESS}');
INSERT INTO `faq` (`id_faq`, `question`, `answer`, `status`, `user_type`, `addedon`) VALUES
(9, 'How does the app work####', 'Download our app and simple on screen selections will get you there in no time. Alternatively you may refer to the ''how it works'' tab and download the guide. There are detailed explanations and step by step illustrations.', 'Active', 'customer', '2017-01-18 02:56:33'),
(10, 'What are the areas that will be charged with a surcharge?', 'A surcharge of $5 will be charged if the parcel is entering Sentosa.', 'Active', 'customer', '2017-01-18 02:57:07'),
(11, 'What if no one is there to receive the parcel?', 'You may contact the delivery agents to reschedule a redelivery at no additional cost. However, if the parcels fails to be delivered on the second attempt, it will be returned to the sender with a $5 return fee.', 'Active', 'customer', '2017-01-18 02:58:01'),
(12, 'Why is my delivery request not accepted?', 'If the delivery request is not accepted, it means that there is no available agent to deliver the parcel. This may happen due to excessive requests at the same time. Please wait patiently for our next available agent to accept the delivery request. All unaccepted request will be removed at the end of the day.', 'Active', 'customer', '2017-01-18 02:58:58'),
(13, 'If I have a parcel to be returned to me after the delivery, what should I do####', 'Please contact the recipient directly to arrange a return once item is delivered. Should the recipient refuse delivery and request a return on the spot, it is the responsibility of sender and recipient to provide our agent a prepaid envelope and indicate the address on it, our agent will then mail it back to you via post.', 'Active', 'customer', '2017-01-18 03:00:04'),
(14, 'What can I ship with Kourier?', 'You can ship just about anything. However do refer to our prohibited list of items in legal section (http://www.kourier.sg/legal).', 'Active', 'customer', '2017-01-18 03:00:29'),
(15, 'Do I need to pack my items?', 'Yes. Sender will have to pack their own items and ensure that they are properly sealed. Please do indicate address and special instructions clearly. It is the responsibility of the sender to ensure that fragile items are properly bubble wrapped and packed in a secure manner.', 'Active', 'customer', '2017-01-18 03:00:59'),
(16, 'What if my parcel is lost?', 'All our delivery assignments are tracked via GPS. In the unfortunate event that the parcel is lost, we will compensate you the value of your parcel or S$150 per parcel, whichever is lower.', 'Active', 'customer', '2017-01-18 03:01:32'),
(17, 'Can I send multiple parcel? Picking up from one location and send to different locations.', 'Yes. You can add multiple parcels on your delivery request. Each parcel will have its own tracking number.', 'Active', 'customer', '2017-01-18 03:01:55'),
(18, 'How do I know if the parcel had been delivered?', 'The status of the delivery will be updated on the mobile app. Once it has been delivered, you will receive a mobile and email notification and be able to view the delivery details. The delivery details includes the name, signature of the receiver who has signed off and the date/time of delivery.', 'Active', 'customer', '2017-01-18 03:02:34'),
(19, 'What modes of payments can i use for the delivery?', 'We will accept CASH payments, Credit Cards and Paypal.', 'Active', 'customer', '2017-01-18 03:03:14'),
(20, 'Can I cancel the job after I have submitted the delivery request?', 'Yes, you may make a cancellation as long you have not received any confirmation from our delivery agents.', 'Active', 'customer', '2017-01-18 03:09:05'),
(21, 'Are there any tracking for my parcel?', 'Yes, you will see the tracking number under your delivery request. You can view the status under Manage Deliveries or alternatively key in the unique tracking number to view the status on our webpage at http://www.kourier.sg.', 'Active', 'customer', '2017-01-18 03:09:41'),
(22, 'How does the app work####', 'Download our app and simple on screen selections will get you there in no time. Alternatively you may refer to the ''how it works'' tab and download the guide. There are detailed explanations and step by step illustrations.', 'Active', 'delivery_agent', '2017-01-18 03:14:24'),
(23, 'Why am I not able to accept jobs?', 'All delivery agents would have to complete their profile registration. After doing so, account approval takes up to 1 week to verify your background information with the authorities. If you are facing issues on uploading your profile, you would need to enable Kourier app permission to access your camera. Please go to General->Settings->Permission. In the Permission tab, you have to click on Camera, Storage and Your Location options to allow the permissions to the app. Then completely CLOSE the app and login again.', 'Active', 'delivery_agent', '2017-01-18 03:15:19'),
(24, 'Why canâ€™t I upload my profile pictures?', 'This is likely due to your phone settings which do not allow permission for the Kourier app to access your camera and photos. Please go to General->Settings->Permission. In the Permission tab, you have to click on Camera, Storage and Your Location options to allow the permissions to the app. Then restart your phone and login again.', 'Active', 'delivery_agent', '2017-01-18 03:15:54'),
(25, 'Do I need a car to be a delivery agent?', 'No, you can use any mode of transport. Our App will clearly indicate the parcel size and weight for you.', 'Active', 'delivery_agent', '2017-01-18 03:16:19'),
(26, 'What if I lost the parcels?', 'For the lost of packages, the compensation will be borne by the agents as agents are responsible for the delivery of the parcels. You will need to inform us and the customer, and we will get the cost of the item from the customer. Thus, it is highly recommended to note down the cost of the item upon pick up.', 'Active', 'delivery_agent', '2017-01-18 03:16:55'),
(27, 'What if no one is around to receive the parcel?', 'Agents are advised to make a call to check if someone is around to receive. If there is no receiver when delivering the parcel, agent will have to make a redelivery at the earliest available date with no additional fee. However, if the parcel cannot be delivered on the second attempt, it will be returned to the sender with a $5 return fee. Please contact sender and Kourier Admin to inform any failed delivery before returning parcel.', 'Active', 'delivery_agent', '2017-01-18 03:17:44'),
(28, 'Why are there no jobs####', 'The jobs will be removed once they are accepted by other agents. On average, 90% of delivery requests are accepted within 10mins of posting. Kindly check back the application regularly.', 'Active', 'delivery_agent', '2017-01-18 03:18:22'),
(29, 'Will my personal particulars be viewed by others?', 'No. Only authorized staff of Kourier will have access to your information. The sender of the parcels will only have your contact number and picture.', 'Active', 'delivery_agent', '2017-01-18 03:18:41'),
(30, 'How much commission do I need to pay####', 'No commission will be payable to Kourier. You will earn 100% from the delivery. (*Subjected to revision without prior notice)', 'Active', 'delivery_agent', '2017-01-18 03:19:04'),
(31, 'Can I turn off the GPS?', 'Yes. The GPS tracking can be turned off. GPS tracking is also automatically turned off when you log out from the app. However, you will need to turn on your GPS tracking before you can accept a job and when you are delivering a parcel.', 'Active', 'delivery_agent', '2017-01-18 03:19:32'),
(32, 'What are Kourier operating hours####', 'Kourier app is 24/7! You can submit the delivery request anytime through our app. Our customer service is open from 10am - 6pm and our delivery agents deliver on standard hours between 9am - 10pm weekdays only. Our customer service is closed on SUN/ PUBLIC HOLIDAYS.', 'Active', 'delivery_agent', '2017-01-18 03:20:09'),
(33, 'Why do deliveries agent need to be verified?', 'Kourier is built on a trusted community of delivery agents. We need to verify the agents to prove their identities and protect our users.', 'Active', 'delivery_agent', '2017-01-18 03:20:36'),
(34, 'Can I cancel the delivery after accepting the job####', 'Yes. Jobs can be cancelled within 30minutes from accepting the job and as long as parcel has not been collected. Please note that multiple cancellation will lead to suspension of account and subject to admin to lift ban. Should you be banned, contact admin@kourier.sg and we will review your case.', 'Active', 'delivery_agent', '2017-01-18 03:21:18'),
(36, 'Do agents deliver on Saturdays, Sundays and Public Holidays####', 'Our agents deliver only on business days not including weekends and public holidays.', 'Active', 'customer', '2017-08-15 12:37:25'),
(37, 'If I have a parcel to be returned to me after the delivery, what should I do####', 'Please contact the recipient directly to arrange a return once item is delivered. Should the recipient refuse delivery and request a return on the spot, it is the responsibility of sender and recipient to provide our agent a prepaid envelope and indicate the address on it, our agent will then mail it back to you via post.', 'Active', 'customer', '2017-08-15 12:44:00'),
(38, 'What are Kourier operating hours####', 'Kourier app is 24/7! You can submit the delivery request anytime through our app. Our customer service is open from 10am - 6pm and our delivery agents deliver on standard hours between 9am - 10pm weekdays only. Our customer service is closed on SUN/ PUBLIC HOLIDAYS.', 'Active', 'customer', '2017-08-15 12:46:15'),
(39, 'How do I get paid for the delivery?', 'Once you have accepted a job,  you will be able to view the payment method. For cash payments, please collect cash directly from sender upon pick up. Should the payment be Credit Card or Paypal, we will do a payout via GIRO bank transfer to your bank account. Payout will take place every Friday and each transfer may take 2-3 working days. Job has to be completed with status updated to delivered before you get paid.', 'Active', 'delivery_agent', '2017-09-24 16:42:01'),
(40, 'Only For Testing Purpose', 'Testing Purpose', 'Active', 'customer', '2018-03-29 10:46:17'),
(41, '11111111AOnly For testing Purpose', 'Testing Purpose', 'Active', 'delivery_agent', '2018-03-29 10:46:57');
