INSERT INTO `static_pages` (`id_static`, `title`, `short_description`, `description`, `link`, `created_date`) VALUES
(1, 'About Us', 'About Us', '<p>A team that loves to deliver.<br /><br />Founded in 2016, Kourier is created to fulfil the demand for postal services and connect consumers and drivers. Our mission is to provide fast, reliable and convenient service. <br /><br />We believe that we are the best at what we do and look forward to being of service to you.<br /><br />Let&rsquo;s work together and please feel free to drop us an email at admin@kourier.sg or SMS (only) us at 84380331.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'about-us', '2016-05-30 09:44:18'),
(2, 'Privacy Policy', 'Policy', '<p><strong>Veloce Pte Ltd Privacy Policy<br /></strong></p>\r\n<p>This Privacy Policy (&ldquo;Policy&rdquo;) applies to all products and services offered by Veloce Pte Ltd (&ldquo;Kourier,&rdquo; &ldquo;we,&rdquo; or &ldquo;us&rdquo;). If you have any questions about this Policy, please feel free to contact us through our website or email us at&nbsp;admin@kourier.sg Capitalized terms used but not defined in this Policy shall have the meaning assigned to such terms in Kourier&rsquo;s Terms of Service (&ldquo;Privacy,&rdquo; available at&nbsp;www.kourier.sg/privacy), and Your access to and use of our Service is subject to the Terms.</p>\r\n<p><span style="text-decoration: underline;"><strong>Collection of Personal Data</strong></span></p>\r\n<p><strong>&ldquo;Personal Data&rdquo;</strong> means information about you, from which you are identifiable, including but not limited to your name, identification card number, birth certificate number, passport number, nationality, address, telephone number, fax number, bank details, credit card details, race, gender, date of birth, marital status, resident status, education background, financial background, personal interests, email address, your occupation, your designation in your Kourier, your Kourier details, the industry in which you work in, any information about you which you have provided to Veloce Pte Ltd in registration forms, application forms or any other similar forms and/or any information about you that has been or may be collected, stored, used and processed by Kourier from time to time and includes sensitive personal data such as data relating to health, religious or other similar beliefs.<br />The provision of your Personal Data is voluntary. However if you do not provide Veloce Pte Ltd your Personal Data, Veloce Pte Ltd will not be able to process your Personal Data for the Purposes and Additional Purposes outlined below.<br />If you are an agent, vendor, supplier or service provider, provision of your Personal Data is mandatory and failure to provide your Personal Data, may be a breach of laws or regulatory requirements, and may cause Veloce Pte Ltd to be unable to engage you to provide services or products or issue payments to you for products or services provided. In addition to the Personal Data you provide to Veloce Pte Ltd directly, Veloce Pte Ltd may collect your Personal Data from a variety of sources such as:</p>\r\n<ol>\r\n<li>Fill up application or registration forms or other similar forms;</li>\r\n<li>From publicly available sources such as directories,</li>\r\n<li>From Veloce Pte Ltd&rsquo;s social media pages, if you follow, like or are a fan of such pages;</li>\r\n<li>From credit reporting agencies;</li>\r\n<li>When you interact and communicate with Veloce Pte Ltd at any events or activities;</li>\r\n<li>When you enter contests organized by Veloce Pte Ltd;</li>\r\n<li>From various entities or divisions under Veloce Pte Ltd; or</li>\r\n<li>By using Veloce Pte Ltd websites, which includes all websites operated by Veloce Pte Ltd and under the names of its respective brands (&ldquo;Websites&rdquo;). Your personal data may also be collected from cookies used on the Websites.</li>\r\n</ol>\r\n<p><span style="text-decoration: underline;"><strong>Purposes of Processing</strong></span>&nbsp;Veloce Pte Ltd may use and process your Personal Data for business and activities of Veloce Pte Ltd which shall include, without limitation the following (&ldquo;Purpose&rdquo;):<br /><span style="text-decoration: underline;">Where you are a customer of the services provided by Veloce Pte Ltd:</span></p>\r\n<ul>\r\n<li>to perform the Veloce Pte Ltd&rsquo;s obligations in respect of any contract entered into with you;</li>\r\n<li>to provide you with any service you have requested;</li>\r\n<li>to process your subscriptions and to deliver the services to you;</li>\r\n<li>where you have requested to download and use the Kourier App (&ldquo;App&rdquo;), to process your request, to deliver the App to you and to provide you a license for the use of the App;</li>\r\n<li>to process your participation in any events, activities, focus groups, research studies, contests, promotions, polls, surveys or any productions;</li>\r\n<li>to process, manage or verify your application for subscription with the Veloce Pte Ltd and to provide you the benefits offered to subscribers;</li>\r\n<li>to validate your bookings and process payments relating to any products or services you have requested;</li>\r\n<li>to understand and analyses our sales as well as your needs and preferences;</li>\r\n<li>to develop, enhance and provide products and services to meet your needs;</li>\r\n<li>to process exchanges or product returns;</li>\r\n</ul>\r\n<p><span style="text-decoration: underline;">Where you are an agent, vendor, supplier, partner, contractor or service provider:</span></p>\r\n<ul>\r\n<li>for the purposes of engaging you to provide services or products;</li>\r\n<li>to facilitate or enable any checks as may be required by Veloce Pte Ltd in order to engage you;</li>\r\n<li>to process payments relating to any products or services you have provided;</li>\r\n<li>to contact you or your Veloce Pte Ltd;</li>\r\n</ul>\r\n<p><span style="text-decoration: underline;">General:</span></p>\r\n<ul>\r\n<li>to respond to questions, comments and feedback from you;</li>\r\n<li>to communicate with you for any of the purposes listed in this Notice;</li>\r\n<li>for internal administrative purposes, such as auditing, data analysis, database records;</li>\r\n<li>for purposes of detection, prevention and prosecution of crime;</li>\r\n<li>for Veloce Pte Ltd to comply with its obligations under law;</li>\r\n</ul>\r\n<p>and you agree and consent to Veloce Pte Ltd using and processing your Personal Data for the Purposes and in the manner as identified in this Notice.</p>\r\n<p><br />By voluntarily providing us with personal information, you hereby represent that you are the owner of such personal information or are otherwise authorized to provide it to Kourier. You further agree that you are consenting to our collection, use, storage and/or disclosure of such personal information in accordance with this Policy. You acknowledge and agree that your communications with Kourier will inevitably result in the transfer of information, including personal information, across international boundaries. If you provide personal information to Kourier through our Service, you acknowledge and agree that such personal information may be transferred from your current location to the offices and servers of Kourier and the authorized third parties referred to herein, located in Singapore, and other countries (the &ldquo;Other Countries&rdquo;) for storage and processing in accordance with this Policy. You acknowledge and agree that the privacy and data security laws of such Other Countries may be different from the privacy and data security laws in force in the country in which you reside and agree that the privacy and security laws in effect in the applicable Other Countries may govern how your personal information may be collected, used, stored and/or disclosed.</p>\r\n<p><br />Kourier uses "cookies" to enable you to sign in to our Service and to help personalize your online experience. A cookie is a small text file that is placed on your hard drive by a web page server. Cookies contain information that can later be read by a web server in the domain that issued the cookie to you. Cookies cannot be used to run programs or deliver viruses to your computer.</p>\r\n<p><br />Kourier uses cookies to store your and your Agents preferences and other information on your and their computers in order to save time by eliminating the need to repeatedly enter the same information and to display personalized content and appropriate advertising within the Service and on subsequent visits to our websites. We store your unique ID number, and the time you signed in, by placing an encrypted cookie on your hard drive. This cookie allows you to move from page to page within the Service without having to sign in again on each page. When you sign out, these cookies are deleted from your computer. We also use cookies to improve your experience with the Service. For example, your e-mail address may be stored in a cookie that will remain on your computer after you sign out. This cookie allows your e-mail address to be pre-populated, so that you will only need to type your password the next time you sign in.</p>\r\n<p><br />You have the ability to accept or decline cookies. Most Web browsers automatically accept cookies, but you can usually modify your browser setting to decline cookies if you prefer. To learn more how to control cookie settings through your browser:</p>\r\n<ul>\r\n<li>Click&nbsp;here&nbsp;to learn more about the &ldquo;Private Browsing&rdquo; setting and cookie setting in FireFox;</li>\r\n<li>Click&nbsp;here&nbsp;to learn more about &ldquo;Incognito&rdquo; and cookie setting in Chrome;</li>\r\n<li>Click&nbsp;here&nbsp;to learn more about &ldquo;InPrivate&rdquo; and cookie setting in Internet Explorer; or</li>\r\n<li>Click&nbsp;here&nbsp;to learn more about &ldquo;Private Browsing&rdquo; and cookie setting in Safari.</li>\r\n</ul>\r\n<p>If you want to learn more about cookies, or how to control or delete them, please visit&nbsp;http://www.aboutcookies.org&nbsp;for detailed guidance. In addition, certain third party advertising networks, including Google, permit users to opt out of or customize preferences associated with your internet browsing. To learn more about this feature from Google, click&nbsp;here.<br />Please note that if you do elect to disable your web browser&rsquo;s ability to accept cookies, you may not be able to access or take advantage of many features of the Service.<br />Many jurisdictions require or recommend that website operators inform users as to the nature of cookies they utilize and, in certain circumstances, obtain the consent of their users to the placement of certain cookies. If you are a customer of Kourier, it is your responsibility to inform the individuals with whom you interact using the Service as to the types of cookies utilized in the Service and, as necessary, to obtain their consent. If you require more specific information as to the nature of the cookies utilized in the Service for purposes of fulfilling these obligations, please contact us by email at&nbsp;admin@kourier.sg</p>\r\n<p><strong>Log information</strong><br />When you use the Service, our servers automatically record information that your browser sends during your use of the Service. These server logs may include information such as your web request, Internet Protocol address, browser type, browser language, the date and time of your request and one or more cookies that may uniquely identify your browser and mobile device</p>\r\n<p><br /><strong>User communications</strong><br />When you send email or other communication to Kourier, we may collect the personal information you provide us and may use it in order to process your inquiries, respond to your requests and improve our services.<br />As a Kourier customer you may receive occasional marketing communications regarding our products and services. You can opt out of receiving marketing communications from Kourier please contact us at&nbsp;admin@kourier.sg. or follow the unsubscribe instructions included in our marketing communications.</p>\r\n<p><br /><strong>Non-Identifiable Data</strong><br />When you interact with Kourier through the Service, we receive and store certain information, which is collected passively using various cookies and similar technologies, and cannot presently be used to specifically identify you. We also engage third party providers to serve a variety of marketing cookies that track and analyze usage, navigational and other statistical information from visitors to Our Site, which does not include personal information but . Kourier and its service providers may store such information itself or such information may be stored in databases owned and maintained by Kourier or its agents or service providers. Our Service may use such information and pool it with other information to track, for example, the total number of visitors to Our Site, the number of visitors to each page of Our Site, or the domain names of Our visitors'' Internet service providers.</p>\r\n<p><br />When you interact with Kourier through the Site, we use third party providers to serve a variety of marketing and operational cookies that enable us to track and analyze usage, navigational and other statistical information from visitors to the Site, and to improve the operation of the Site. This information does not include personal information though we may re-associate this information with personal information we have collected when it is received. Marketing cookies are also used to track the performance of our advertisements and are employed by third party advertising networks that We utilize. These advertising networks follow online activities of visitors to the Site and use this information to inform, optimize and serve tailored advertisements on the Site or on other Websites they visit that we believe would most effectively promote the Service to you. we also use third parties to collect information that assists us in other methods of &ldquo;remarketing&rdquo; our Service to visitors to the Site, including customized email communications.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Aggregated Information</strong></p>\r\n<p><br />In an ongoing effort to better understand and serve our Customers, Kourier often conducts research on its customer demographics, interests and behaviour based on the personal and other information provided to us. This research may be compiled and analyzed on an aggregate basis, and Kourier may share or otherwise publish or distribute this aggregate data. This aggregate information does not identify you personally. Kourier may also disclose aggregated user statistics in order to describe Our Service to current and prospective business partners, customers and to other third parties for other lawful purposes.</p>\r\n<p><br />INFORMATION SHARING<br />Kourier currently processes personal information on its servers located in Singapore. We may change the locations in which we process personal information from time to time, including by commencing personal information processing in additional or different Other Countries.</p>\r\n<p><br />Kourier only shares personal information with other third parties outside of Kourier in the following limited circumstances:</p>\r\n<ul>\r\n<li>We have obtained our customer&rsquo;s consent.</li>\r\n<li>We sometimes hire third parties perform certain business-related functions. Examples of such functions include maintaining databases and processing payments or otherwise providing us with necessary software, networking, storage and other services we use to provide and operate the service. When we employ a third party to perform a function of this nature, we only provide them with the information that they need to perform their specific function.</li>\r\n<li>We have a good faith belief that access, use, preservation or disclosure of such information is reasonably necessary to:</li>\r\n</ul>\r\n<p style="padding-left: 60px;">1. satisfy any applicable law, regulation, legal process or enforceable governmental request;<br />2. enforce the Terms, including investigation of potential violations thereof;<br />3. detect, prevent, or otherwise address fraud, security or technical issues, or;<br />4. protect against imminent harm to the rights, property or safety of Kourier, its users or the public as required or permitted by law.</p>\r\n<p><br />If Kourier becomes involved in a merger, acquisition, or any form of sale of some or all of its assets, we will provide notice before personal information is transferred and becomes subject to a different privacy policy.</p>\r\n<p><br />We may share with third parties certain pieces of aggregated, non-personal information, such as the number of users who searched for a particular term, for example, or how many users clicked on a particular advertisement. Such information does not identify you individually.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>DATA INTEGRITY</strong></p>\r\n<p><br />Kourier processes personal information only in accordance with this Policy or any applicable service-specific privacy notice. We review our data collection, storage and processing practices to ensure that we only collect, store and process the personal information needed to provide or improve our products and services. We take reasonable steps to ensure that the personal information we process is accurate, complete, and current, but we depend on our users to update or correct their personal information whenever necessary. Customers of Kourier may update or change the personal information they have provided to Kourier by logging into the Service and providing such information where applicable. Kourier will retain personal information we process on behalf of our customers for as long as needed to provide the Service to our customers. We may further retain and use this personal information as necessary to comply with our legal obligations, resolve disputes, maintain accurate accounting, financial and other operational records and enforce our agreements. Kourier has not direct relationship with the individuals with whom our customers may interact using the Service. Any such individual seeking access to, or who would like to correct, amend or delete data that may be stored in the Service should direct his or her inquiry to the applicable Kourier customer.</p>\r\n<p><br /><strong>SECURITY</strong></p>\r\n<p><br />Kourier takes reasonable steps to protect personal information collected through our service from loss, misuse, and unauthorized access, disclosure, alteration, or destruction. However, no Internet or electronic transmission (including email) is ever fully secure or error free. Therefore, you should take special care in deciding what information you send to us via the Internet.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>OTHER IMPORTANT MATTERS</strong><br />Children<br />Kourier does not knowingly collect personal information from children under the age of 13. If you are under the age of 13, please do not submit any personal information through our services. We encourage parents and legal guardians to monitor their children&rsquo;s Internet usage and to help enforce our Policy by instructing their children never to provide personal information on our Service without their permission. If you have reason to believe that a child under the age of 13 has provided personal information to Kourier through our Service, please contact us, and we will use commercially reasonable efforts to delete that information from our databases.<br />Other Products/Services<br />This Policy only applies to the products and services of Veloce Pte Ltd and not to the products or services of any other entity, affiliate or other third parties (&ldquo;Third Parties&rdquo;), even if such products or services are linked, integrated or sold in conjunction with our Service. Any links, integrations, or co-sales from or with our Service do not imply that Kourier endorses or has reviewed the practices of any such Third Parties. You should contact such Third Parties directly for information on their privacy policies.</p>\r\n<p><br /><span style="text-decoration: underline;"><strong>Acknowledgement and Consent</strong></span></p>\r\n<p><br />By communicating with Veloce Pte Ltd, using Veloce Pte Ltd&rsquo;s services, purchasing products from Veloce Pte Ltd or by virtue of your engagement with Veloce Pte Ltd, you acknowledge that you have read and understood this Notice and agree and consent to the use, processing and transfer of your Personal Data by Veloce Pte Ltd as described in this Notice.<br />Veloce Pte Ltd shall have the right to modify, update or amend the terms of this Notice at any time by placing the updated Notice on the Websites. By continuing to communicate with Veloce Pte Ltd, by continuing to use Veloce Pte Ltd&rsquo;s services, purchasing products from Veloce Pte Ltd or by your continued engagement with Veloce Pte Ltd following the modifications, updates or amendments to this Notice, such actions shall signify your acceptance of such modifications, updates or amendments. In the event of any conflict between the English and other language versions, the English version shall prevail.</p>', 'privacy-policy', '2016-06-01 12:41:37'),
(4, 'Terms and Conditions', 'Legal', '<p>Kourier is a technology platform that brings together service providers including couriers &amp; movers with customers who are using the Service (as defined below) (the "<span style="text-decoration: underline;">Customers</span>") provided by Veloce Pte Ltd company registration number 201604544W, registered at 10 Anson Road #26-04 International Plaza, Singapore 079903, admin@kourier.sg (the "<span style="text-decoration: underline;">Company</span>", "we, "us" or "our", as the context requires).</p>\r\n<p><br />Kourier is a technology company that does not directly provide delivery and moving services and the Company is not a transportation and delivery provider. It is up to the drivers or movers (the "<span style="text-decoration: underline;">Delivery Providers</span>") to accept your delivery services and it is up to you (references to "You", "Your" or "User" shall mean references to each visitor to the Website (as defined below), as the context requires) to accept their request for your delivery (the "<span style="text-decoration: underline;">Delivery Request</span>"). The service of the Company is to link you with the Delivery Providers (the "<span style="text-decoration: underline;">Service</span>") through the use of an application supplied by Kourier and downloaded and installed by you on your single mobile or tablet device (the "<span style="text-decoration: underline;">Application</span>"), but does not nor is it intended to provide delivery services or any act that can be construed in any way as an act of a Delivery Provider. The Company is not responsible nor liable for the acts and/or omissions of any Delivery Provider and/or any delivery or moving services provided to you.</p>\r\n<p><br />These terms and conditions (the "<span style="text-decoration: underline;">User Terms</span>") govern your use of our web site at http:// www.kourier.sg (the "<span style="text-decoration: underline;">Website</span>") and your relationship with us (the "Contract"), the Service and the Application, as well as to all information and/or services provided to you on or through the Website, the Service and the Application.</p>\r\n<p><br />Please read these User Terms carefully as they affect your rights and obligations under the law. If you do not agree to the User Terms, please do not register for or use the Website.</p>\r\n<p><strong>1.&nbsp;&nbsp;&nbsp; USE OF THE WEBSITE/APP</strong></p>\r\n<p style="padding-left: 30px;">1.1&nbsp;&nbsp;&nbsp; The Website/App is provided to you for your personal use subject to the User Terms. By using the Website/App you agree to be bound by the User Terms.</p>\r\n<p><br /><strong>2.&nbsp;&nbsp;&nbsp; REGISTRATION&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong></p>\r\n<p style="padding-left: 30px;">2.1. You must be 18 years old and over and must complete the registration process in order to participate in our Service.</p>\r\n<p style="padding-left: 30px;">2.2. In order to submit a Delivery Request, we will require your contact number so that we can contact you to facilitate a delivery, if required.</p>\r\n<p><strong>3.&nbsp;&nbsp;&nbsp; YOUR USE OF KOURIER</strong></p>\r\n<p style="padding-left: 30px;">3.1. You warrant that you are either the owner or the authorised agent of the owner of the goods, items or parcels to be delivered to or by the Delivery Providers (the "Delivery Items"), and that you are authorised to accept and is accepting these User Terms not only for yourself but also as agent for and on behalf of the owner of the Delivered Items.</p>\r\n<p style="padding-left: 30px;">3.2. It is your responsibility to package your Delivery Item for delivery appropriately. We will not accept liability for damage or breakage caused by poor packing which contravenes these requirements. Further, we will not accept Delivery Items which in the opinion of Delivery Providers are inappropriately packed, or disparate loose unpacked Items. Delivery Requests rejected on this basis will not be eligible for refund. The Customer shall ensure that the Delivery Item is adequately packed so as to protect against damage to the Delivery Item during the course of delivery.</p>\r\n<p style="padding-left: 30px;">3.3. (In the case of a Delivery Item of a fragile nature) that the Delivery Item shall be packed in a case or container of sufficient durability and strength and shall be encased in or surrounded by sufficient and suitable protective material inside that case or container such that the Delivery Item is guarded against damage that may result from any force, pressure or blows to which postal items are ordinarily subject during the course of delivery and that such Delivery Item shall bear the words "FRAGILE" prominently displayed in capital letters on the face of the case or container and above the address of the named addressee.</p>\r\n<p style="padding-left: 30px;">3.4. (In the case of a Delivery Item which is susceptible to damage by bending) that the Delivery Item shall be packed in a case or container of sufficient durability and strength to prevent the Delivery Item from being bent or otherwise damaged during the course of delivery and such case or container shall bear the words "DO NOT BEND" prominently displayed in capital letters on the face of the case or container and above the address of the named addressee.</p>\r\n<p style="padding-left: 30px;">3.5. The User shall provide in respect of each Delivery Item all necessary information (the "Delivery Information"), including without limitation:</p>\r\n<p style="padding-left: 60px;">3.5.1.&nbsp;&nbsp;&nbsp; the User&rsquo;s name, address (including the postal code and unit number) and telephone number;</p>\r\n<p style="padding-left: 60px;">3.5.2.&nbsp;&nbsp;&nbsp; the addressee&rsquo;s name, delivery address (including the postal code and unit number) and telephone number;</p>\r\n<p style="padding-left: 60px;">3.5.3.&nbsp;&nbsp;&nbsp; provide an least an image of the item if it is non flat so that delivery driver knows what items they are picking up and size of item; and</p>\r\n<p style="padding-left: 60px;">3.5.4.&nbsp;&nbsp;&nbsp; Special precautions to be taken in respect of the Delivery Item e.g. "FRAGILE", "PERISHABLE", "DO NOT BEND" etc.;</p>\r\n<p style="padding-left: 30px;">3.6&nbsp;&nbsp;&nbsp; The User warrants that he or she has complied with all laws and regulations relating to the nature, condition, packing, handling, storage and carriage of the Delivery Items. The User shall not dispatch and Delivery Providers reserve the right to refuse any Delivery Item that is prohibited by law, dangerous or hazardous materials, perishable substances and radioactive material, without limitation:</p>\r\n<p style="padding-left: 60px;">3.6.1&nbsp;&nbsp;&nbsp; Explosives, firearms or other offensive weapons, flammable or hazardous materials, poisonous or infectious substances, blood or blood products (whether infectious or not);</p>\r\n<p style="padding-left: 60px;">3.6.2&nbsp;&nbsp;&nbsp; Human or animal remains;</p>\r\n<p style="padding-left: 60px;">3.6.3&nbsp;&nbsp;&nbsp; Live animals;</p>\r\n<p style="padding-left: 60px;">3.6.4&nbsp;&nbsp;&nbsp; Cash;</p>\r\n<p style="padding-left: 60px;">3.6.5&nbsp;&nbsp;&nbsp; Share, certificates or other documents evidencing title to securities or real properties;</p>\r\n<p style="padding-left: 60px;">3.6.6&nbsp;&nbsp;&nbsp; Original copies of any record, drawing, document or electronic recording of which duplicates or copies have not been made and kept by you;</p>\r\n<p style="padding-left: 60px;">3.6.7&nbsp;&nbsp;&nbsp; Precious metals and stones;</p>\r\n<p style="padding-left: 60px;">3.6.8&nbsp;&nbsp;&nbsp; Illegal narcotics or drugs; and</p>\r\n<p style="padding-left: 60px;">3.6.9&nbsp;&nbsp;&nbsp; Any Delivery Item (or its contents thereof) of a value exceeding S$1,000.00.</p>\r\n<p style="padding-left: 60px;">3.9.10&nbsp;&nbsp;&nbsp; Any items classified under the General Prohibitions list as defined under the Singapore Postal Services Regulations 2008, the Health Sciences Authority of Singapore and the latest UPU Regulations. All senders are to note the prohibitions and refer to the relevant authorities when in doubt. Where there is a conflict or contradiction between the Singapore Postal Services Regulations 2008 and UPU Regulations, the Singapore Postal Services Regulations 2008 will take precedence.&nbsp;</p>\r\n<p style="padding-left: 30px;"><br />3.7&nbsp;&nbsp;&nbsp; The User is liable for any loss or damage suffered by any third party as a result of any breach of the terms. Delivery Providers will not open and inspect the Delivery Items, and shall bear no responsibility in any legal liability resulting from the transportation of the Delivery Items.</p>\r\n<p style="padding-left: 30px;">3.8&nbsp;&nbsp;&nbsp; In the event a Delivery Request is not completed because the Delivery Provider was late to reach the recipient for reasons that are not the Customer&rsquo;s responsibility, and not described as circumstances outside our control, Kourier&rsquo;s Customer Service will contact the Customer to arrange redelivery, free of charge.</p>\r\n<p style="padding-left: 30px;">3.9&nbsp;&nbsp;&nbsp; In the event that the recipient is found to be absent from the address specified by you and no other person is present to take the Delivery Item(s), the Delivery Provider will contact you as the Delivery Requester to request further instructions on how to proceed. In the event you cannot be contacted either, you authorize us to decide on your behalf as we deem appropriate. You acknowledge that additional charges might arise as a result of Delivery Request completion failure due to missing recipient (e.g. cancellation fee, additional waiting time, new Delivery Request).</p>\r\n<p style="padding-left: 30px;">3.10&nbsp;&nbsp;&nbsp; We shall use the Delivery Information to process your Delivery Request, including, but not limited to, generating a list of Delivery Services (references to "Delivery Service" refers to service for delivery of the Delivered Item, as the context requires) available for the Delivery Request, as well as a quotation for the related cost or price for each specific delivery of the Delivery Item(s) (the "Delivery Price"). Quotations will be valid for at least 15 minutes, after which you may need to re-submit the request along with the Delivery Information to obtain new Delivery Services and prices.</p>\r\n<p style="padding-left: 30px;">3.11&nbsp;&nbsp;&nbsp; Your Delivery Request is deemed completed upon receipt by us of proof of delivery by signature in electronic form or by other evidence such as the Delivery Provider&rsquo;s confirmation of delivery.</p>\r\n<p style="padding-left: 30px;">3.12&nbsp;&nbsp;&nbsp; The Delivery Item(s) will be delivered to the specified Delivery address in the Delivery Information, but not necessarily to the named recipient personally. Nonetheless, the name of the actual recipient of the Delivery Items will be captured together with his/her signature upon delivery by the Delivery Provider using the Kourier driver mobile app.</p>\r\n<p style="padding-left: 30px;">3.13&nbsp;&nbsp;&nbsp; The Delivery Requester and the recipient will be able to track the Delivery Request status on Kourier&rsquo;s platform until Delivery Request is completed. Tracking will be possible on the Delivery Item(s) level, but not on the item inside the Delivery Item. You should keep track of what items are inside each Delivery Item.</p>\r\n<p style="padding-left: 30px;">3.14&nbsp;&nbsp;&nbsp; By using the Application or the Service you further agree that you will not use the Website/App for any of the following purposes:</p>\r\n<p style="padding-left: 60px;">3.14.1&nbsp;&nbsp;&nbsp; disseminating any unlawful, harassing, libellous, abusive, threatening, harmful, vulgar, obscene, or otherwise objectionable material or otherwise breaching any laws;</p>\r\n<p style="padding-left: 60px;">3.14.2&nbsp;&nbsp;&nbsp; transmitting material that encourages conduct that constitutes a criminal offence, or otherwise breaches any applicable laws, regulations or code of practice;</p>\r\n<p style="padding-left: 60px;">3.14.3&nbsp;&nbsp;&nbsp; causing nuisance, annoyance or inconvenience whilst using the Website/App; or</p>\r\n<p style="padding-left: 60px;">3.14.4&nbsp;&nbsp;&nbsp; making, transmitting or storing electronic copies of materials protected by copyright without the permission of the owner.<br />We may suspend or terminate the Contract and cancel your registration should you not comply with any of the terms under Clause 3 above or we may also terminate the Contract and cancel the registration without cause by giving you 7 days&rsquo; notice in writing by email to your registered email address.</p>\r\n<p style="padding-left: 30px;">3.15&nbsp;&nbsp;&nbsp; Additional $5 will be imposed for every block of 10 minutes waiting time.</p>\r\n<p><br /><strong>4.&nbsp;&nbsp;&nbsp; CHARGES AND PAYMENT</strong></p>\r\n<p style="padding-left: 30px;">4.1.&nbsp;&nbsp;&nbsp; It is free to download and use Kourier driver and customer app.<br />4.2.&nbsp;&nbsp;&nbsp; Once a delivery method and starting point/end point has been entered into the app / Website, it will provide Users with the Delivery Price. By confirming the Delivery Request, you accept to pay the Delivery Price quoted.<br />4.3.&nbsp;&nbsp;&nbsp; Customers will pay the Company via Cash in Singapore dollars made to the delivery agent or through credit card payments available via Brain Tree Payment Gateway.</p>\r\n<p><br />5.&nbsp;&nbsp;&nbsp; <strong>CANCELLATION</strong></p>\r\n<p style="padding-left: 30px;">5.1.&nbsp;&nbsp;&nbsp; No cancellation is allowed once a user taps on the "CONFIRM DELIVERY" button for movers or couriers to be confirmed.<br />5.2.&nbsp;&nbsp;&nbsp; Cancellation fee will apply to the Customer if Delivery Request is cancelled after it has been confirmed. This may apply where cancellation takes place when the Delivery Provider is on the way to collect the Delivery Item(s) from the Customer, or when the Delivery Provider is delivering the Delivery Item(s) to the recipient.. The cancellation fee will be 50% of the Delivery Price of the respective Contract.</p>\r\n<p><br /><strong>6.&nbsp;&nbsp;&nbsp; LOSS OF OR DAMAGE</strong></p>\r\n<p style="padding-left: 30px;">6.1.&nbsp;&nbsp;&nbsp; In the event that the Delivery Providers or the Company discovers that there has been loss of or damage to the Delivery Item, the Company or the Delivery Providers shall notify the Customer of such loss or damage within a reasonable period from such loss or damage and shall seek instructions from the User with respect to the appropriate action to be taken. The Company reserves the right to decline to accept any further instructions for any reason whatsoever.</p>\r\n<p style="padding-left: 30px;">6.2.&nbsp;&nbsp;&nbsp; In the event that the Customer does not provide further instructions regarding the appropriate action to be taken within a reasonable period of us notifying the Customer of the loss or damage, we shall take such action in relation to the Delivery Item as we deem appropriate, including without limitation, re-delivery of the Delivery Item to the Customer or retention of the Delivery Item, and shall notify the Customer of the same.</p>\r\n<p style="padding-left: 30px;">6.3.&nbsp;&nbsp;&nbsp; All costs arising from further action taken in relation to the Delivery Item in accordance with Clauses 6.1 and 6.2 above shall be borne by the Customer, unless the loss or damage to the Delivery Item was caused by our gross negligence in which case Clause 7 below shall apply.</p>\r\n<p><br /><strong>7.&nbsp;&nbsp;&nbsp; LIMITATIONS AND EXCLUSIONS OF COMPANY&rsquo;S LIABILITY</strong></p>\r\n<p style="padding-left: 30px;">7.1.&nbsp;&nbsp;&nbsp; We shall not be liable for loss or damage arising from or in connection with:</p>\r\n<p style="padding-left: 60px;">7.1.1.&nbsp;&nbsp;&nbsp; the delivery of any of the Delivery Items set out in Clause 3.5.4 and 3.6;</p>\r\n<p style="padding-left: 60px;">7.1.2.&nbsp;&nbsp;&nbsp; the User&rsquo;s failure to specify any special precautions to be taken in respect of a Delivery Item, as required under Clause 3.3 and 3.4, on the address label, consignment note, waybill and/or invoice;</p>\r\n<p style="padding-left: 60px;">7.1.3.&nbsp;&nbsp;&nbsp; the misalignment, wear and tear, de-arrangement, heat, mould, rot, discolouration, degeneration, explosion, ignition or the hazardous, perishable, corruptible, fragile, or brittle nature of the contents of the Delivery Item;</p>\r\n<p style="padding-left: 60px;">7.1.4.&nbsp;&nbsp;&nbsp; delay or confiscation by any government authority due to the discovery of prohibited contents of the Delivery Item;</p>\r\n<p style="padding-left: 60px;">7.1.5.&nbsp;&nbsp;&nbsp; our failure to perform any of our obligations hereunder as a consequence of circumstances outside our control, including without limitation any act of God such as weather conditions, flood or earthquake, work stoppages, strikes, industrial disputes, war, any act of government, accidents, traffic obstructions or congestion, mechanical breakdown, epidemics or other events of force majeure; or</p>\r\n<p style="padding-left: 60px;">7.1.6.&nbsp;&nbsp;&nbsp; any acts or omissions of any party other than us, including and without limitation the User, the named addressee, any government official or any sub- contractor engaged by us (whether or not the User had notice of any arrangement between Kourier and such sub-contractor).</p>\r\n<p style="padding-left: 30px;">7.2.&nbsp;&nbsp;&nbsp; Although we will endeavour to deliver your Delivery Items within the indicated timeframe, any delivery times stated or agreed or represented are estimates only. Delivery times may be affected by a number of factors, including those outside of our control such failure of equipment, bad weather and/or traffic conditions. While timely delivery is an important commitment, we place equal importance in ensuring the safety of the drivers / riders, and the due observance of traffic regulations.</p>\r\n<p style="padding-left: 30px;">7.3.&nbsp;&nbsp;&nbsp; We shall not be liable for indirect or consequential loss or damage, including without limitation loss of profit, income, interest, future business or anticipated savings, even if the risk of such loss or damage was brought to our attention before or after acceptance of the Delivery Item or from the use or the inability to use the Website, the Service or the Application.</p>\r\n<p style="padding-left: 30px;">7.4.&nbsp;&nbsp;&nbsp; We shall not be liable for delay or non-delivery of a Delivery Item arising from or in connection with the detention of the Delivery Item by any government authority.</p>\r\n<p style="padding-left: 30px;">7.5.&nbsp;&nbsp;&nbsp; For the avoidance of doubt, we shall not in any way be liable or responsible for a Delivery Item prior to the Delivery Item being accepted by us for delivery.</p>\r\n<p style="padding-left: 30px;">7.6.&nbsp;&nbsp;&nbsp; Notwithstanding Clause 6.3 above, the parties agree that the Company&rsquo;s liability for any loss of or damage to any Delivery Item shall be limited to the declared value of the Delivery Item or S$100.00, whichever is the lower.</p>\r\n<p><br /><strong>8.&nbsp;&nbsp;&nbsp; PROMOTIONS</strong></p>\r\n<p style="padding-left: 30px;">8.1.&nbsp;&nbsp;&nbsp; Our promotions may be introduced from time to time at our sole discretion. All promotions provided are subject to the prevailing regulatory requirements. We reserve the right to revise, suspend or terminate these requirements or User Terms at any time and we may withdraw the offer at our discretion without prior notice.</p>\r\n<p><strong>9.&nbsp;&nbsp;&nbsp; INDEMNITY</strong></p>\r\n<p style="padding-left: 30px;">9.1.&nbsp;&nbsp;&nbsp; By accepting the User Terms and using the Service and the Application, the User shall indemnify the Company and keep the Company indemnified against all demands, claims, action, proceedings, costs, charges or expenses including but not limited to penalties, storage charges, retrieval and administrative costs, duties and taxes incurred, suffered or sustained by us in connection with the Service we have provided.</p>\r\n<p><strong>10.&nbsp;&nbsp;&nbsp; MISCELLANEOUS</strong></p>\r\n<p style="padding-left: 30px;">10.1&nbsp;&nbsp;&nbsp; We may update the User Terms from time to time which will apply to the use of the Company site at via "www.kourier.sg" and such changes shall be binding on the User upon posting.</p>\r\n<p style="padding-left: 30px;">10.2&nbsp;&nbsp;&nbsp; If any provision of the Driver Terms is found to be invalid or unenforceable in whole or in part by any tribunal, court or competent authority, the other provisions shall remain valid and continue to apply to the parties.</p>\r\n<p style="padding-left: 30px;">10.3&nbsp;&nbsp;&nbsp; No person other than a party to this Contract may enforce the Contract by virtue of the Contract (Rights of Third Parties) Act, Cap. 53B of the Republic of Singapore, but this does not affect any right or remedy of the third party which exists or is available apart from that Act.</p>\r\n<p style="padding-left: 30px;">10.4&nbsp;&nbsp;&nbsp; We reserve the right to revise the User Terms at any time without prior notice.</p>\r\n<p style="padding-left: 30px;">10.5&nbsp;&nbsp;&nbsp; User Terms shall be governed by and construed in accordance with the laws of Singapore.</p>\r\n<p style="padding-left: 30px;">10.6&nbsp;&nbsp;&nbsp; The User submits to the non-exclusive jurisdiction of the courts of Singapore.</p>', 'legal', '2016-11-04 05:26:17'),
(5, 'How it Works', 'How it Works', '<p>Simply download the PDF file for either customer or delivery agent to understand how the app works to achieve your needs.</p>', 'how-it-works', '2016-12-15 04:26:59'),
(6, 'New Rates', 'New Rates', '<p>A team that loves to deliver.<br /><br />Founded in 2016, Kourier was created to fulfil the demand for postal services and connect consumers and drivers. Our mission is to provide fast, reliable and convenient service. <br /><br />We believe that we are the best at what we do and look forward to being of service to you.<br /><br />Let&rsquo;s work together and please feel free to drop us an email at admin@kourier.sg</p>\r\n', 'new-rates', '2016-12-29 06:44:08');
