INSERT INTO `website_features` (`id`, `title`, `description`, `type`, `updatedon`) VALUES
(1, 'Make Requests', 'To have your parcel</br> delivered in time.', 'features', '2017-08-15 04:14:51'),
(2, 'Engage the Delivery Agent', 'As per your preference and get </br>your parcel delivered.', 'features', '2017-08-15 04:15:22'),
(3, 'Review & Rate', 'The delivery agents based on<br>your experience with them.', 'features', '2016-11-03 09:47:24'),
(4, 'Fixed Price', 'Prices clearly stated upfront.<br>No need for quotes.', 'features-more', '2016-11-04 03:38:20'),
(5, 'Reliable', 'Approved agents passed background checks. Digital signatures at delivery.', 'features-more', '2016-11-03 10:28:32'),
(6, 'Easy, Fast & Affordable', 'No more queues, quotes and paperwork.Direct contact with person<br>doing the delivery.', 'features-more', '2017-03-10 11:47:35'),
(7, 'Track Your Parcel', 'SMS notifications to your receivers<br>and track your parcel live.', 'features-more', '2016-11-03 10:28:39'),
(8, 'Batch Deliveries', 'Multiple delivery orders from<br>one pickup location.', 'features-more', '2016-11-03 10:28:43'),
(9, 'Live Tracking', 'Track location of delivery agent</br> with status updates.', 'features-more', '2017-08-15 04:16:16');
INSERT INTO `website_slider` (`id`, `title`, `title2`, `description`, `image`, `addedon`) VALUES
(1, 'Know More', 'About Kourier', 'Kourier is created to fulfil the demand for postal services and connect consumers and drivers. Our mission is to provide fast, reliable and convenient service. Let''s work together and please feel free to contact us via the link below or drop us an email at <a href="mailto:admin@kourier.sg" target="_top">admin@kourier.sg</a>', '20161103212033_slide.jpg', '2016-11-03 12:21:54'),
(3, 'Learn More', 'Our Vision', 'To enrich lives by providing a total logistics solution.', '20161103212019_slide.jpg', '2016-11-03 12:26:09');
